  name: `AT-AT`,
  description: `The All Terrain Armored Transport, or AT-AT walker, is a four-legged transport and combat vehicle used by the Imperial ground forces. Standing over 20 meters tall with blast-impervious armor plating, these massive constructs are used as much for psychological effect as they are for tactical advantage.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/AT-AT_89d0105f.jpeg`
}, {
  name: `AT-ST`,
