  description: `These brick-colored atmospheric vehicles keep the peace in the skies of Bespin. Cloud cars feature twin “pods” connected by a repulsorlift engine, and are equipped with light blaster cannons. Each cloud car has a pilot and a gunner, who work in tandem to intercept starships bound for Cloud City, question their captains and take defensive measures as needed.`,
