}, {
  name: `Sail barge`,
  description: `Jabba the Hutt valued money and power, and enjoyed showing off just how much he had of both. The Khetanna, his luxury sail barge, was among the crimelord’s most extravagant purchases: a massive transport that carried up to 500 passengers, maintained a crew of 26, and was outfitted with space for live music and entertainment. It was manufactured by Ubrikkian, measuring 30 meters long and equipped with a heavy blaster cannon -- an essential feature for Jabba’s lifestyle. Indeed, the craft was symbolic of Jabba’s hubris and ego, and played a large part in his downfall.`,
