}, {
  name: `Multi-Troop Transport`,
  description: `A terrifying display of Trade Federation efficiency, the mammoth MTT (Multi Troop Transport) is an armored giant capable of disgorging over a hundred battle droid soldiers into the thick of combat. The vehicle's bulbous armored front end opens to reveal an articulated deployment rack, upon which rest dozens of compressed battle droids. The rack extends forward and deposits the droids into neatly organized rows. Upon activation from an orbiting Droid Control Ship, the droids unfold into their humanoid configuration. During the Clone Wars, the Separatist Army used MTTs in Confederacy livery to transport their infantry troops to many battlefields.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/databank_mtt_01_169_efb8a98a.jpeg`
}, {
  name: `Armored Assault Tank`,
  description: `The marriage of repulsorlift technology and heavy armor has resulted in formidable floating tanks known as AATs. These assault tanks form the frontline of Trade Federation armored infantry divisions, as well as Separatist forces during the Clone Wars. A crew of battle droids drives the battle tank and operates the array of laser and projectile weaponry carried by the vehicle.`,
