}, {
  name: `Single Trooper Aerial Platform`,
  description: `STAPs are lightweight reconnaissance and patrol vehicles used by the battle droids of the Trade Federation army (and later, the Separatist Alliance). Incorporating repulsorlift technology, the STAP (single trooper aerial platform) is a slim, agile craft sporting a pair of blaster cannons. STAPs are often deployed as support vehicles in conjunction with larger craft.`,
