}, {
  name: `C-9979 landing craft`,
  description: `With its huge wingspan and imposing boot-shaped loading ramp, the Trade Federation landing ship was a daunting sight. Once the immense vessels set down on a clear and secured landing field, they disgorged AATs, MTTs, troop transports and battle droids into the battlefield. These vessels saw heavy use in the military of the Separatist Alliance.`,
