  name: `AT-TE`,
  description: `The principal battle tank of the Grand Army of the Republic, the All Terrain Tactical Enforcer features six articulated legs for propulsion. The legs are low to the ground, which reduces the walker's top speed but does provide it with increased stability. The body of the walker consists of two armored halves connected by a flexible sleeve that increases its mobility on the field. The walker is truly all terrain, able to climb sheer surfaces and survive in the vacuum of outer space. The front of the walker is lined with four ball-turret laser cannons, while a single heavy projectile cannon is turret-mounted on the vehicle's dorsal surface. Its rear fire arc is protected by a pair of laser cannon turrets. Though the walker's armor can easily deflect small arms fire, tanksmasher rockets can pierce an AT-TE's armor and destroy its complex propulsion mechanisms.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/at-te-main_09471f2b.jpeg`
}, {
  name: `SPHA`,
  description: `These twelve-legged gun platforms are the largest ground based weapons in the arsenal of the Republic army. It takes no less than 30 clone troopers to man the monstrous turbolaser beams, but they are powerful and effective enough to blast through starship shields and hulls.`,
  vehicleImgSrc: `https://lumiere-a.akamaihd.net/v1/images/self-propelled-heavy-artillery-turbolaser_1d69d1e5.jpeg`
}, {
  name: `Flitknot speeder`,
  description: `This speederbike was a favorite of Count Dooku’s. Sometimes referred to as a “Flitknot Speeder,” these bikes are fast and maneuverable, able to outrun Republic gunships. Dooku used one to escape the first battle of Geonosis and make it back to his Solar Sailer to fight another day. They are of simple design, with more bulk at the back in the engines than anywhere else. They have two handholds and two footholds, making them perfect for bipeds.`,
