  description: `For transit from their enormous Trade Federation battleships to the surface of their economically or militarily conquered worlds, Neimoidian officials travel in a distinctively shaped Neimoidian escort shuttle. Curved insect-like landing gears lower from the ship's belly, giving the craft's legs a pincer-like appearance as it settles on a landing pad.`,
